        [TestMethod]
        public async Task GetImage_NotFound()
        {
            // Arrange
            // None

            // Act
            HttpResponseMessage response = await controller.Get("3617ebac-a459-xxxx-bb15-9be01b06cc48");

            // Assert
            Assert.AreEqual(response.StatusCode, HttpStatusCode.NotFound);
        }
        [TestMethod]
        public async Task GetImage_ImageFound()
        {
            // Arrange

            // Act
            HttpResponseMessage response = await controller.Get(this.guid);

            // Assert
            Assert.AreEqual(response.StatusCode, HttpStatusCode.OK);
            Assert.AreEqual(response.Content.Headers.ContentLength, 21838);
            Assert.AreEqual("image/jpeg", response.Content.Headers.ContentType.MediaType);

        }
        [TestMethod]
        public async Task DeleteImage_NotFound()
        {
            // Arrange

            // Act
            HttpResponseMessage response = await controller.Delete("3617ebac-a459-xxxx-bb15-9be01b06cc48");

            // Assert
            Assert.AreEqual(response.StatusCode, HttpStatusCode.NotFound);
        }
        [TestMethod]
        public async Task DeleteImage_NoContent()
        {
            // Arrange

            // Act
            HttpResponseMessage response = await controller.Delete(this.guid);

            // Assert
            Assert.AreEqual(response.StatusCode, HttpStatusCode.NoContent);
        }
        private ImagesController GetController()
        {
            return new ImagesController
            {
                Request = new System.Net.Http.HttpRequestMessage(),
                Configuration = new HttpConfiguration()
            };
        }
        private ByteArrayContent CreateFileContent(byte[] stream, string fileName, string contentType)
        {
            ByteArrayContent fileContent = new ByteArrayContent(stream);
            fileContent.Headers.ContentDisposition = new ContentDispositionHeaderValue("form-data")
            {
                Name = "\"files\"",
                FileName = "\"" + fileName + "\""
            };
            fileContent.Headers.ContentType = new MediaTypeHeaderValue(contentType);
            return fileContent;

        }
        private byte[] CreateImage()
        {
            const string image = "";
            List<byte> byteList = new List<byte>();

            string hexPart = image.Substring(2);
            for (int i = 0; i < hexPart.Length / 2; i++)
            {
                string hexNumber = hexPart.Substring(i * 2, 2);
                byteList.Add((byte)Convert.ToInt32(hexNumber, 16));
            }

            byte[] data = byteList.ToArray();

            return data;
        }
    }
